class Solution:
    def solve(self, board):
        """
        :type board: List[List[str]]
        :rtype: void Do not return anything, modify board in-place instead.
        """
        if len(board) == 0: return
        m, n = len(board), len(board[0])
        
        def on_border(x, y):
            # O(1) check
            return x == 0 or x == m-1 or y == 0 or y == n-1
        
        visited = [[False] * n for _ in range(m)]
        
        def dfs(x, y):
            """
            Search for 'O' regions from 'O' location (x, y)
            If child search result returns as False, abandon search and return False.
            If all child search result returns as True, return True
            """
            res = True
            visited[x][y] = True
            
            if on_border(x, y):
                return False
            
            for dx, dy in zip([1, -1, 0, 0], [0, 0, 1, -1]):
                nx, ny = x+dx, y+dy
                if 0 <= nx < m and 0 <= ny < n and board[nx][ny] == 'O' and not visited[nx][ny]:
                    res &= dfs(nx, ny)
                       
            if res:
                board[x][y] = 'X'
            return res
        
        
        for r, row in enumerate(board):
            for c, val in enumerate(row):
                if val == 'O' and not visited[r][c]:
                    dfs(r, c)
                    


